import React from 'react';

class Banner1 extends React.Component {
    render() {
        return (
            <section class='banner-1'>
                <div class='container'>
                    <div class='row'>
                        <div class='col-12'>
                            Banner1
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}
export default Banner1;
